        byte[] HextoBytes(string sttr)
        {
            byte[] stttr = null;

            string tttr = "";

            for (int n = 0; n < sttr.Length; n = n + 1)
            {
                string tt = sttr.Substring(n, 1);
                if (
                    (tt == "0") |
                    (tt == "1") |
                    (tt == "2") |
                    (tt == "3") |
                    (tt == "4") |
                    (tt == "5") |
                    (tt == "6") |
                    (tt == "7") |
                    (tt == "8") |
                    (tt == "9") |
                    (tt == "A") |
                    (tt == "B") |
                    (tt == "C") |
                    (tt == "D") |
                    (tt == "E") |
                    (tt == "F") |
                    (tt == "a") |
                    (tt == "b") |
                    (tt == "c") |
                    (tt == "d") |
                    (tt == "e") |
                    (tt == "f")
                    )
                {
                    if (tt == "a") tt = "A";
                    if (tt == "b") tt = "B";
                    if (tt == "c") tt = "C";
                    if (tt == "d") tt = "D";
                    if (tt == "e") tt = "E";
                    if (tt == "f") tt = "F";
                    tttr = tttr + tt;
                }
            }

            stttr = new byte[tttr.Length / 2];

            for (int n = 0; n < tttr.Length-1; n = n + 2)
            {
                string tt = tttr.Substring(n, 2);
                int aa = 0;
                int bb = 0;
                if (tt.Substring(0, 1) == "0") aa = 0;
                if (tt.Substring(0, 1) == "1") aa = 1;
                if (tt.Substring(0, 1) == "2") aa = 2;
                if (tt.Substring(0, 1) == "3") aa = 3;
                if (tt.Substring(0, 1) == "4") aa = 4;
                if (tt.Substring(0, 1) == "5") aa = 5;
                if (tt.Substring(0, 1) == "6") aa = 6;
                if (tt.Substring(0, 1) == "7") aa = 7;
                if (tt.Substring(0, 1) == "8") aa = 8;
                if (tt.Substring(0, 1) == "9") aa = 9;
                if (tt.Substring(0, 1) == "A") aa = 10;
                if (tt.Substring(0, 1) == "B") aa = 11;
                if (tt.Substring(0, 1) == "C") aa = 12;
                if (tt.Substring(0, 1) == "D") aa = 13;
                if (tt.Substring(0, 1) == "E") aa = 14;
                if (tt.Substring(0, 1) == "F") aa = 15;
                if (tt.Substring(1, 1) == "0") bb = 0;
                if (tt.Substring(1, 1) == "1") bb = 1;
                if (tt.Substring(1, 1) == "2") bb = 2;
                if (tt.Substring(1, 1) == "3") bb = 3;
                if (tt.Substring(1, 1) == "4") bb = 4;
                if (tt.Substring(1, 1) == "5") bb = 5;
                if (tt.Substring(1, 1) == "6") bb = 6;
                if (tt.Substring(1, 1) == "7") bb = 7;
                if (tt.Substring(1, 1) == "8") bb = 8;
                if (tt.Substring(1, 1) == "9") bb = 9;
                if (tt.Substring(1, 1) == "A") bb = 10;
                if (tt.Substring(1, 1) == "B") bb = 11;
                if (tt.Substring(1, 1) == "C") bb = 12;
                if (tt.Substring(1, 1) == "D") bb = 13;
                if (tt.Substring(1, 1) == "E") bb = 14;
                if (tt.Substring(1, 1) == "F") bb = 15;
                stttr[n/2] = (byte)(aa *16+bb);
            }

            return stttr;
        }

        string DectoHex_Uint(long xx)
        {
            string hh = "";

            if (xx < 0) xx = 0;

            while (xx >= 16)
            {
                if (xx - ((xx / 16) * 16) == 0) hh = "0" + hh;
                if (xx - ((xx / 16) * 16) == 1) hh = "1" + hh;
                if (xx - ((xx / 16) * 16) == 2) hh = "2" + hh;
                if (xx - ((xx / 16) * 16) == 3) hh = "3" + hh;
                if (xx - ((xx / 16) * 16) == 4) hh = "4" + hh;
                if (xx - ((xx / 16) * 16) == 5) hh = "5" + hh;
                if (xx - ((xx / 16) * 16) == 6) hh = "6" + hh;
                if (xx - ((xx / 16) * 16) == 7) hh = "7" + hh;
                if (xx - ((xx / 16) * 16) == 8) hh = "8" + hh;
                if (xx - ((xx / 16) * 16) == 9) hh = "9" + hh;
                if (xx - ((xx / 16) * 16) == 10) hh = "A" + hh;
                if (xx - ((xx / 16) * 16) == 11) hh = "B" + hh;
                if (xx - ((xx / 16) * 16) == 12) hh = "C" + hh;
                if (xx - ((xx / 16) * 16) == 13) hh = "D" + hh;
                if (xx - ((xx / 16) * 16) == 14) hh = "E" + hh;
                if (xx - ((xx / 16) * 16) == 15) hh = "F" + hh;
                xx = xx / 16;
            }

            string mm = hh;

            if (xx == 0) hh = "0" + mm;
            if (xx == 1) hh = "1" + mm;
            if (xx == 2) hh = "2" + mm;
            if (xx == 3) hh = "3" + mm;
            if (xx == 4) hh = "4" + mm;
            if (xx == 5) hh = "5" + mm;
            if (xx == 6) hh = "6" + mm;
            if (xx == 7) hh = "7" + mm;
            if (xx == 8) hh = "8" + mm;
            if (xx == 9) hh = "9" + mm;
            if (xx == 10) hh = "A" + mm;
            if (xx == 11) hh = "B" + mm;
            if (xx == 12) hh = "C" + mm;
            if (xx == 13) hh = "D" + mm;
            if (xx == 14) hh = "E" + mm;
            if (xx == 15) hh = "F" + mm;

            return hh;
        }

        string OnlyDigits(string sttr)
        {
            string stttr = "";
            for (int n = 0; n < sttr.Length; n = n + 1)
            {
                if (
                    (sttr.Substring(n, 1) == "1") |
                    (sttr.Substring(n, 1) == "2") |
                    (sttr.Substring(n, 1) == "3") |
                    (sttr.Substring(n, 1) == "4") |
                    (sttr.Substring(n, 1) == "5") |
                    (sttr.Substring(n, 1) == "6") |
                    (sttr.Substring(n, 1) == "7") |
                    (sttr.Substring(n, 1) == "8") |
                    (sttr.Substring(n, 1) == "9") |
                    (sttr.Substring(n, 1) == "0")
                    )
                {
                    stttr = stttr + sttr.Substring(n, 1);
                }
            }
            return stttr;
        }

